['Some of my favourite takeaways from the shows in Taipei and Seoul! Which is your favorite? And what emotion do they convey in your perspective?', 'Truly amazed by how much details are retained in the 48 MP photo, you also see how the beautiful highlights are not so blown out even up close. All in the tiny details! #shotoniphone #iphone14promax', 'Gentle music with the gentle rotationâ˜ºï¸', 'Gotta do itğŸ˜Œ', 'I thought i would share a little POV of how i usually go about photographing music concerts, it takes a little bit of stealth, planning and running :) hope you enjoy let me know! First 3 seconds by @ramishakabir', "After 2 months of intense but fulfilling schedule, the US All 4 Nothing tour issa wrapğŸ¥º â€¢ bittersweet but one thing's for sure, will do this again in a heartbeat! Shoutout to every single member of the crew who gave their absolute best to make the show world classğŸ¤

And biggest shoutout to the king @lauvsongs , you shine like never before, displayed only the best of best performance on stage and even better, a true kind and gentleman off stage. As a photographer, I have the unique perspective of seeing how the artist sees the audience and how they see the artist, I love this unique position, to take that in and create the best storytelling visuals as I can. It's so easy to create for Ari because of how authentic he is, it truly is an honor to watch everything off stage and in the daily. 

Last but not least, I hope my photos do justice to the shows and hopefully, give you a glimpse of how the daily life of touring is. This is one of the best jobs in the world i'm so lucky to do thisğŸ™ğŸ» Singapore, I'm so proud to represent you and you're my one and only home, coming back to you, for now :) till the next one!", "I'm kinda guilty doing these thoğŸ˜³", "I've went to so many places around the world and one thing's for sure, i always keep a lookout for colorful visuals, a compilation of what I shot! Can you guess where each one is from?", 'Some San Francisco classicsğŸŒ†', "Wow.. a proposal on stage, and she said yes! Swipe to the second pic which might be my absolute favourite shot of the tour so far - Ari's covering his face crying, the couple hugging and crowd at the back, a perfect composition 

